import React, { Component } from 'react';
import Recipe from './Recipe';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      Name: "Mohib"
    }
  }

  render(){
    return(
      <div>
        <Recipe 
        title="Pasta" 
        ingredients={["Flour", "Water"]}
        instructions="Mix Ingredients"
        img="spaghetti.jpg"
         />
      </div>
    );
  }
}

export default App;
